import React, { useEffect, useState } from 'react';
import { Button, Form, Dropdown, Alert, ListGroup, Container, Row, Col } from 'react-bootstrap';
import axios from 'axios';
import NavBar from "../../components/Navbar";

function GroupChatApp() {
    const [groups, setGroups] = useState([]); // full group objects with id + name
    const [selectedGroup, setSelectedGroup] = useState('');
    const [message, setMessage] = useState('');
    const [messages, setMessages] = useState([]);
    const [inputValue, setInputValue] = useState('');
    const [notifications, setNotifications] = useState([]);

    // Fetch available groups on component mount
    useEffect(() => {
        const fetchGroups = async () => {
            try {
                const response = await axios.get('http://localhost:8080/group');
                console.log("Fetched groups:", response.data);
                setGroups(response.data); // Store full group objects
            } catch (err) {
                console.error('GET /group failed:', err);
            }
        };

        fetchGroups();
    }, []);

    const handleCreateGroup = async (e) => {
        e.preventDefault();
        if (!inputValue.trim()) return;

        try {
            const response = await axios.post('http://localhost:8080/group/create', { name: inputValue });
            const newGroup = { name: inputValue, id: null }; // fallback id as null
            setGroups(prev => [...prev, newGroup]);
            setSelectedGroup(inputValue);
            setInputValue('');
        } catch (err) {
            console.error('Create group error:', err);
        }
    };
    useEffect(() => {
        if (!selectedGroup) return;
    
        const selected = groups.find(g => g.name === selectedGroup);
        if (!selected || !selected.id) return;
    
        axios.get(`http://localhost:8080/message/group/${selected.id}`)
            .then(res => {
                setMessages(res.data);
            })
            .catch(err => console.error("Fetching messages failed", err));
    }, [selectedGroup]);
    
    const handleSend = async () => {
        if (!inputValue.trim() || !selectedGroup) return;

        try {
            const group = groups.find(g => g.name === selectedGroup);
            if (!group || !group.id) {
                console.error("Group not found or missing ID.");
                return;
            }

            const messagePayload = {
                "message": inputValue
            };

            await axios.post(`http://localhost:8080/message/post?groupChatId=${group.id}`, messagePayload);

            setNotifications(prev => [...prev, inputValue]);
            setInputValue('');
        } catch (err) {
            console.error('Sending message failed:', err);
        }
    };


    return (
        <div>
            <NavBar />
            <Container className="mt-4">
                <h3>Group Chat App</h3>

                {/* Group Selector & Create */}
                <Row className="mb-3">
                    <Col md={6}>
                        <Dropdown onSelect={setSelectedGroup}>
                            <Dropdown.Toggle variant="primary">
                                {selectedGroup || 'Select Group'}
                            </Dropdown.Toggle>
                            <Dropdown.Menu>
                                {groups.map((g, i) => (
                                    <Dropdown.Item key={i} eventKey={g.name}>{g.name}</Dropdown.Item>
                                ))}
                            </Dropdown.Menu>
                        </Dropdown>
                    </Col>

                    <Col md={6}>
                        <Form onSubmit={handleCreateGroup}>
                            <Form.Control
                                type="text"
                                placeholder="Create new group"
                                value={inputValue}
                                onChange={e => setInputValue(e.target.value)}
                            />
                            <Button type="submit" className="mt-2">Create Group</Button>
                        </Form>
                    </Col>
                </Row>

                {/* Messaging Section */}
                {selectedGroup && (
                    <>
                        <Alert variant="info">Latest message: {message}</Alert>

                        <Form className="d-flex mb-3">
                            <Form.Control
                                type="text"
                                placeholder="Enter message"
                                value={inputValue}
                                onChange={e => setInputValue(e.target.value)}
                            />
                            <Button onClick={handleSend} className="ms-2">Send</Button>
                        </Form>
                    </>
                )}

                {/* Notifications */}
                <h5>Notifications</h5>
                <ListGroup>
                    {notifications.map((note, i) => (
                        <ListGroup.Item key={i}>{note}</ListGroup.Item>
                    ))}
                </ListGroup>
            </Container>
        </div>
    );
}

export default GroupChatApp;
